import React from 'react';

import { Navbar, Nav, NavItem } from 'reactstrap';


const Footer = () => {
  return (
    <Navbar>
      <Nav navbar>
        <NavItem>
          2020 SW Vault
        </NavItem>
      </Nav>
    </Navbar>
  );
};

export default Footer;
